import React, { Component, component } from 'react'

export class CreatePhrase extends Component {
    constructor(props) {
        super(props)

        this.state = {
            fullname: '',
            zip: ''
        }
    }

    changeHandler = (e) => {
        this.setState({ [e.target.name]: e.target.value })
    }

    submitHandler= e => {
        e.preventDefault()
        console.log(this.state)
    }

    render() {
        const { fullname, zip } = this.state
        return (
            <div>
                <form onSubmit={this.submitHandler}>
                    <div>
                        <input type="text" name="fullname" value={fullname} onChange={this.changeHandler} />
                    </div>
                    <div>
                        <input type="text" name="zip" value={zip} onChange={this.changeHandler} />
                    </div>
                    <button type='submit'>Submit</button>
                </form>
            </div>
        )
    }
}
